import "./Button.css";
import playIcon from '../../icon-play.png';
import pauseIcon from '../../icon-pause.png';

const Button = ({ active, text, ...btnProps }) => {

  let img = null;


  return (
    <button
      className={active ? ".btn-active" : "btn-disabled"}
      {...btnProps}
    >

    {text === 'Start' &&
      <img src={playIcon} width="30" alt="Start" />
    }


      {text}
    </button>
  );
};

export default Button;
